import 'bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
	return (
		<div className="App">
			<Navigation />
			<h1 className="display-1">Twiter Showcase App</h1>
		</div>
	);
}

export default App;
